【サイズ】約全高３５～４３ｍｍ（キャラクターによって異なります）<br>
【材質】ＰＶＣ<br>
発売元：株）４４１LABO<br>
中国製<br><br>

フィギュア第３弾は「革の街シリーズ」！<br>
シルクハットに燕尾服、蝶ネクタイでおしゃれした仲間たちがイラストから飛び出しました。<br>
このセットで、ダヤン、ジタン、マーシィにバニラの全４種が揃います！<br><br>
※４個セットのみの取り扱いです。 <br><br>


【ご確認事項】<br>
※曲がり具合やサイズに若干の違いが生じる場合があります。<br>
※加工段階での多少の汚れ・スレ・色ムラ・色ズレ・スレや凸凹・折り曲げ加工の微細なズレ・歪みがある場合もございます。<br>
メーカーより“良品”として販売されております。ご理解頂きご注文をお願い致します。<br><br>

<hr><br>
※イメージ写真の商品はセット品ではありません。<br>
※実際のお色と多少異なる事があります。<br><br>
区分：ネコ　黒ねこ　猫雑貨　ネコグッズ　キャット　cat
<br><br>
池田あきこ　わちふぃーるど　WACHIFIELD<br><br>

